pragma solidity >=0.7.0 <0.9.0;

contract creditOp {
    mapping (address => uint) public user2credit;
    uint256 private initCredit = 10000;
    uint256 private upperLimitCredit = 20000;

    function incCredit(address _user) view public {
        uint credit = user2credit[_user];
        uint16[6] memory bars = [0, 10000, 11000, 15000, 18000, 20000];
        uint8[5] memory incs = [100, 96, 16, 5, 1];
        if (credit < upperLimitCredit) {
            uint i = 0;
            uint j = 1;
            while (j < bars.length) {
                if (bars[i] <= credit && credit < bars[j]) {
                    credit += incs[i];
                }
                i++;
                j++;
            }
        }
    }

    function getCredit(address _user) view public returns(uint) {
        return user2credit[_user] / 100;
    }

    function setCredit(address _user) public {
        user2credit[_user] = initCredit;
    }

}

